style.css:
@-moz-document domain("track.toggl.com") {

[class*="TableCell"] {
	height: 32px;
}


[class*="Trigger"] [class*="Date"], 
[class*="Trigger"] [class*="Time"] {
	border: 0px solid red;
	display: inline;
	margin-right: 10px
}
[class*="Trigger"] [class*="Time"] {
	color: #ccc;
}
[class*="Trigger"] [class*="Time"] span {
	color: #999;
}

}
